s = ""

posibles = []

from datetime import datetime

i = 1
p=0
while i <= len(s):
    for x in range(0,len(s)-i+1):
        sub = s[x:x+i]
        if sub not in posibles:
            #print(sub)
            posibles.append(sub)
            p+=1
    print("[{}] {} - {}".format(datetime.now().strftime("%Y/%m/%d %H:%M:%S"),i,p))
    posibles = []
    i+=1

#print(posibles)
print(p)